package main

import (
    "strconv"
)

// Given a positive integer n, return the product of the odd Digits.
// Return 0 if all Digits are even.
// For example:
// Digits(1)  == 1
// Digits(4)  == 0
// Digits(235) == 15
func Digits(n int) int {
    product := 1
    hasOdd := false

    for _, digit := range strconv.Itoa(n) {
        d := int(digit - '0')
        if d%2 != 0 {
            product *= d
            hasOdd = true
        }
    }

    if !hasOdd {
        return 0
    }

    return product
}
